SELECT DISTINCT wo.Workorder, BKo.BestNr, BKo.Datum, Standort.SuchCode AS Lagerstandort, Lagerart.Lagerart, Mitarbei.Name AS [Freigabe-User], BKo.FreigabeZeitpkt AS Freigabezeitpunkt, LiefLsKo.LsNr, LiefLsKo.WeDatum
FROM @Workorder AS wo
LEFT JOIN LiefAbKo ON wo.Workorder = RIGHT(REPLICATE(N'0', 10) + LiefAbKo.ABNr, 10)
LEFT JOIN LiefAbPo ON LiefAbPo.LiefABKoID = LiefAbKo.ID
LEFT JOIN BPo ON LiefAbPo.BPoID = BPo.ID
LEFT JOIN BKo ON BPo.BKoID = BKo.ID
LEFT JOIN Standort ON BKo.LagerID = Standort.ID
LEFT JOIN Lagerart ON BKo.LagerartID = Lagerart.ID
LEFT JOIN LiefLsPo ON LiefLsPo.BPoID = BPo.ID
LEFT JOIN LiefLsKo ON LiefLsPo.LiefLsKoID = LiefLsKo.ID
LEFT JOIN Mitarbei ON BKo.FreigabeMitarbeiID = Mitarbei.ID;